import React from 'react';
import "./Source.css";

function Source() {
    return (
        <div className="mainDiv">
            <div className="btnDiv">
                <button type="button" className="button">Buy Airtime</button>
                <button type="button" className="button">Buy Data</button>
                <button type="button" className="button">Cable TV (Dstv, Gotv, Startimes)</button>
                <button type="button" className="button">Buy Electricity</button>
                <button type="button" className="button">Internet Subscription</button>
            </div>
        </div>
    );
}

export default Source;
